import React from 'react'

function Focusinput() {
  state={
    name:"ravan",
   location:"Andhra",
   age:28,

   name1:'Manoj',
   location1:'Guntur',
    age :'34',

   name2:'Bikshu',
    location2:'kurnool',
   age2:'38'
  }
  return (
    <div>
     <h1>{this.state.name}</h1>
    </div>
  )
}

export default Focusinput
